N_simple = size(s, 2);
n_polynomials = size(s, 1);

f = fopen('polynomial_testdata.h', 'w');

for row = 1:n_polynomials
    roots_simple(row,:) = roots(s(row,:));
end

fprintf(f, 'const int N_simple = %d;\n', N_simple);
% we need to fliplr to make it right for the c polynomial representation
matrixToCArray(fliplr(s), 'coefficients_simple', f);
matrixToCArray(real(roots_simple), 'roots_simple_real', f);
matrixToCArray(imag(roots_simple), 'roots_simple_imag', f);

row = 1;
for i=1:3:n_polynomials-1
    vx = polyder(s(i,:));
    vy = polyder(s(i+1,:));
    vz = polyder(s(i+2,:));
    ax = polyder(vx);
    ay = polyder(vy);
    az = polyder(vz);
    coefficients_v_magnitude(row, :) = conv(vx,ax) + conv(vy,ay) + conv(vz,az);
    row = row + 1;
end

for row = 1:size(coefficients_v_magnitude, 1)
    roots_v_magnitude(row,:) = roots(coefficients_v_magnitude(row,:));
end

fprintf(f, 'const int N_v_magnitude = %d;\n', size(coefficients_v_magnitude, 2));
matrixToCArray(fliplr(coefficients_v_magnitude), 'coefficients_v_magnitude', f);
matrixToCArray(real(roots_v_magnitude), 'roots_v_magnitude_real', f);
matrixToCArray(imag(roots_v_magnitude), 'roots_v_magnitude_imag', f);

fclose(f);